import "../css/hover-menu-items-shape.css";

export const HoverMenuItems_Shapes = () => {
  const shapes = [
    { name: "Circle", img: "", whatItDoes: () => {} },
    { name: "Rectangle", img: "", whatItDoes: () => {} },
    { name: "DashedCircle", img: "", whatItDoes: () => {} },
    { name: "Arrow", img: "", whatItDoes: () => {} },
    { name: "Circle", img: "", whatItDoes: () => {} },
    { name: "Circle", img: "", whatItDoes: () => {} },
  ];
  return (
    <div className="container">
      {shapes.map((item, _) => {})}
      <button></button>
    </div>
  );
};

const ButtonComponent = (img, name, event) => {
  return (
    <>
      <button></button>
    </>
  );
};
